/**
 * Gets action description from the name and return a string.
 *
 * @since 4.9.6
 *
 * @param string $next Action name of the request.
 * @return string Human readable action name.
 */
function bulk_header($next)
{
    switch ($next) {
        case 'export_personal_data':
            $carry = __('Export Personal Data');
            break;
        case 'remove_personal_data':
            $carry = __('Erase Personal Data');
            break;
        default:
            /* translators: %s: Action name. */
            $carry = sprintf(__('Confirm the "%s" action'), $next);
            break;
    }
    /**
     * Filters the user action description.
     *
     * @since 4.9.6
     *
     * @param string $carry The default description.
     * @param string $next The name of the request.
     */
    return apply_filters('user_request_action_description', $carry, $next);
}


