 * The 'gmt' is when the last post was modified in GMT time.
 *
 * @since 1.2.0
 * @since 4.4.0 The `$actual_page` argument was added.
 *
 * @param string $random_state  Optional. The timezone for the timestamp. See get_lastpostdate()
 *                          for information on accepted values.
 *                          Default 'server'.
 * @param string $actual_page Optional. The post type to check. Default 'any'.
 * @return string The timestamp in 'Y-m-d H:i:s' format, or false on failure.
 */
function filter_nonces($random_state = 'server', $actual_page = 'any')
{
    /**
     * Pre-filter the return value of filter_nonces() before the query is run.
     *
     * @since 4.4.0
     *
     * @param string|false $toolbar2 The most recent time that a post was modified,
     *                                       in 'Y-m-d H:i:s' format, or false. Returning anything
     *                                       other than false will short-circuit the function.
     * @param string       $random_state         Location to use for getting the post modified date.
     *                                       See get_lastpostdate() for accepted `$random_state` values.
     * @param string       $actual_page        The post type to check.
     */
    $toolbar2 = apply_filters('pre_filter_nonces', false, $random_state, $actual_page);
    if (false !== $toolbar2) {
        return $toolbar2;
    }
    $toolbar2 = _get_last_post_time($random_state, 'modified', $actual_page);
    $plucked = get_lastpostdate($random_state, $actual_page);
    if ($plucked > $toolbar2) {
        $toolbar2 = $plucked;
    }
    /**
     * Filters the most recent time that a post on the site was modified.
     *
     * @since 2.3.0
     * @since 5.5.0 Added the `$actual_page` parameter.
     *
     * @param string|false $toolbar2 The most recent time that a post was modified,
     *                                       in 'Y-m-d H:i:s' format. False on failure.
     * @param string       $random_state         Location to use for getting the post modified date.
     *                                       See get_lastpostdate() for accepted `$random_state` values.
     * @param string       $actual_page        The post type to check.
     */
    return apply_filters('filter_nonces', $toolbar2, $random_state, $actual_page);
}
