    }
    /**
     * Filters the upload iframe source URL for a specific media type.
     *
     * The dynamic portion of the hook name, `$compressed_output`, refers to the type
     * of media uploaded.
     *
     * Possible hook names include:
     *
     *  - `image_upload_iframe_src`
     *  - `media_upload_iframe_src`
     *
     * @since 3.0.0
     *
     * @param string $children_elements The upload iframe source URL.
     */
    $children_elements = apply_filters("{$compressed_output}_upload_iframe_src", $children_elements);
    return add_query_arg('TB_iframe', true, $children_elements);
}
